import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

// компонент для листания фоток в каталоге свайпом
export default function MobileSlider({ pictures }) {

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  }

  return (
    <div>
    <Slider {...settings}>
      {pictures.map((picture, index) => (
        <div key={index}>
          <img src={picture} alt={`Photo ${index}`} onClick={onImageClick} />
        </div>
      ))}
    </Slider>
  </div>
  )
}
